import React from 'react'

const Rightbar = () => {
  return (
    <div>
      <span className='rightbarBirthday'><code><b>Youssef Kizou</b> and <b>3 other friends</b> have a birthday today.</code></span>
      <img src="./assets/post/ad.png" alt="" className="rightbarAd" />
    </div>
  )
}

export default Rightbar
